import React, { useState } from "react";
// import styled from "styled-components";

const dummyData = [
  { name: "John Doe", score: 85, details: "CEO of XYZ Corp. Known for innovation and leadership." },
  { name: "Jane Smith", score: 92, details: "Renowned lawyer with a strong track record in corporate law." },
  { name: "Emily Davis", score: 78, details: "Tech entrepreneur with several successful startups." },
];

const App = () => {
  const [searchTerm, setSearchTerm] = useState("");
  const [results, setResults] = useState([]);

  const handleSearch = () => {
    const filteredData = dummyData.filter((person) =>
      person.name.toLowerCase().includes(searchTerm.toLowerCase())
    );
    setResults(filteredData);
  };

  return (
    <Wrapper>
      <Navbar>
        <NavLogo>PersonScore</NavLogo>
        <NavItems>
          <NavItem>Home</NavItem>
          <NavItem>About</NavItem>
          <NavItem>Contact</NavItem>
        </NavItems>
      </Navbar>

      <MainSection>
        <SearchContainer>
          <SearchTitle>Discover a Person's Score</SearchTitle>
          <SearchInput
            type="text"
            placeholder="Enter a name..."
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <SearchButton onClick={handleSearch}>Search</SearchButton>
        </SearchContainer>

        <ResultsContainer>
          {results.length === 0 ? (
            <NoResults>No results found. Try searching for someone!</NoResults>
          ) : (
            results.map((person, index) => (
              <ResultCard key={index}>
                <ResultName>{person.name}</ResultName>
                <ResultScore>Score: {person.score}</ResultScore>
                <ResultDetails>{person.details}</ResultDetails>
              </ResultCard>
            ))
          )}
        </ResultsContainer>
      </MainSection>

      <Footer>
        <FooterText>Â© 2025 PersonScore. All rights reserved.</FooterText>
      </Footer>
    </Wrapper>
  );
};

export default App;

import styled from "styled-components";

export const Wrapper = styled.div`
  font-family: "Arial", sans-serif;
  color: #333;
  display: flex;
  flex-direction: column;
  min-height: 100vh;
`;

export const Navbar = styled.nav`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background: #2c3e50;
  padding: 1rem 2rem;
  color: white;
`;

export const NavLogo = styled.h1`
  font-size: 1.5rem;
  font-weight: bold;
`;

export const NavItems = styled.div`
  display: flex;
  gap: 1.5rem;
`;

export const NavItem = styled.div`
  cursor: pointer;
  transition: color 0.3s ease;
  &:hover {
    color: #1abc9c;
  }
`;

export const MainSection = styled.main`
  flex: 1;
  padding: 2rem;
  display: flex;
  flex-direction: column;
  align-items: center;
  background: #ecf0f1;
`;

export const SearchContainer = styled.div`
  text-align: center;
  margin-bottom: 2rem;
`;

export const SearchTitle = styled.h2`
  font-size: 2rem;
  margin-bottom: 1rem;
  color: #2c3e50;
`;

export const SearchInput = styled.input`
  width: 300px;
  padding: 0.8rem;
  border: 2px solid #2c3e50;
  border-radius: 5px;
  font-size: 1rem;
  margin-right: 0.5rem;
`;

export const SearchButton = styled.button`
  padding: 0.8rem 1.5rem;
  font-size: 1rem;
  color: white;
  background: #1abc9c;
  border: none;
  border-radius: 5px;
  cursor: pointer;
  transition: background 0.3s ease;
  &:hover {
    background: #16a085;
  }
`;

export const ResultsContainer = styled.div`
  width: 100%;
  max-width: 800px;
  display: flex;
  flex-direction: column;
  gap: 1rem;
`;

export const ResultCard = styled.div`
  padding: 1rem;
  border: 1px solid #2c3e50;
  border-radius: 5px;
  background: white;
  box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
`;

export const ResultName = styled.h3`
  font-size: 1.2rem;
  color: #2c3e50;
`;

export const ResultScore = styled.p`
  font-size: 1rem;
  font-weight: bold;
  color: #1abc9c;
`;

export const ResultDetails = styled.p`
  font-size: 0.9rem;
  color: #7f8c8d;
`;

export const NoResults = styled.p`
  font-size: 1rem;
  color: #7f8c8d;
  text-align: center;
`;

export const Footer = styled.footer`
  background: #2c3e50;
  color: white;
  text-align: center;
  padding: 1rem;
`;

export const FooterText = styled.p`
  font-size: 0.9rem;
  margin: 0;
`;
